export default function NavBar() {
    return (
        <nav className="nav">
            <label className="logo">Stevens Lost & Found Tool</label>
            <ul>
              <li><a className="navb" href="/">Home</a></li>
              <li><a className="navb" href="/report">Report Lost Item</a></li>
              <li><a className="navb" href="/find">Find An Item</a></li>
              <li><a className="navb" href="/about">About</a></li>
            </ul>
        </nav>
    )
}
